const Where = () => (
  <>
    <div className="title text-orange text-center mt-s2">Где?</div>
    <div className="w-screen h-s01 bg-blue opacity-40" />
    <Frame title="Оффлайн:">
      <ul className="space-y-s03 space-y-reverse">
        <li className="arrow-blue">
          <span>Удобное местоположение в центре города.</span>{" "}
        </li>
        <li className="arrow-blue">
          Современное здание, соответствующее российским стандартам
          образовательного учреждения.
        </li>
      </ul>
    </Frame>
  </>
);

export default Where;
